import styled from 'styled-components'

const Secondary = ({className, children}) => (
  <SecondaryStyles className={className}>
    {children}
  </SecondaryStyles>
);

const SecondaryStyles = styled('div')`
  background: var(--white);
  height: 100vh;
  grid-column: 2/3;
  padding: 1.5em;
`;

const List = styled('ul')`
  display: flex;
  flex-direction: column;
  margin: 0;
  padding: 0;
`;

export default Secondary;
